	子弹属性.子弹威力 = 1 * _parent._parent.内力 + (100 + 自机.空手攻击力 * 0.7) * (1 + _parent._parent.技能等级 * 0.7);

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 35;
	子弹属性.击倒率 = 0.01;

	子弹属性.区域定位area = this.area;
	子弹属性.垂直击退速度 = 7;
	子弹属性.不硬直 = true;
	_root.子弹区域shoot传递(子弹属性);
}
	/*
